import './App.css';

function Button(text){
  return (
    <button> text </button>
  );
};

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Button n0></Button>
        <Button n1></Button>
        <Button n2></Button>
        <Button n3></Button>
        <Button n4></Button>
        <Button n5></Button>
        <Button n6></Button>
      </header>
    </div>
  );
}

export default App;
